Those who discovered Collins' music as a result of the hit &quot;A Girl Like You&quot; and enjoyed the disc containing it (Gorgeous George) will also find much to like here. The songwriting, vocals, and arrangements are all similar to those of its more famous successor. The opening track, &quot;Means To An End&quot;, and the Van Morrison-like &quot;Now That It's Love&quot; are my personal favorites but there's plenty of other good stuff as well.
